import React from 'react'
import './Humidity.css'


const Humidity = ({weather, dummyData}) => {
    return (
        <div className='humidity'>
            <p>Humidity</p>
            { weather.main.humidity !== undefined ? (
                <p className='vis-num'>{weather.main.humidity}</p>
            ) : (
                <p className='vis-num'>{dummyData.main.humidity !== undefined ? console.log(dummyData) : 'N/A'}</p>
            )}
        </div>
    )
}

export default Humidity
